import React from 'react';
import {Map, InfoWindow, Marker} from 'google-maps-react';

class Info extends React.Component {

  onClick(){
    alert('Clicked');
  }


 
  render() {
    return (
      <div onClick={this.onClick}>
        {this.props}
        {this.props.map(props => <div>{props.position}</div>)}
      </div>
    );
  }
};
export default Info;
